import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      name: { fName: 'akash', lName: 'verma' },
      company: 'TCS',
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hi {this.state.name.fName} {this.state.name.lName}, you worked at{' '}
            {this.state.company}
          </p>
          {/* <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a> */}
          <button
            onClick={() => {
              this.setState(
                () => {
                  return {
                    name: { fName: 'kritha', lName: 'trimurth' },
                  };
                },
                () => {}
              );
              console.log(this.state);
            }}
          >
            Change Name
          </button>
        </header>
      </div>
    );
  }
}

export default App;
